import React from 'react';
import './style.css'

function Create() {
  return (
    <div className="App-header background">
      <div className='sla'></div>

        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>

    </div>
  );
}

export default Create;
